const Counter = () => {
    const [count, setCount] = useState(10);

    return (
        <div className="h-screen">
            <div className='m-3'>
                <ul className='font-sans font-semibold text-nowrap'>
                    <li className=''>Tanymal</li>
                    <li className=''>Siz ushin</li>
                    <li className=''>Random</li>
                </ul>
            </div>

        </div>
    );
};

export default Counter;
